import { TextField, ThemeProvider } from "@mui/material";
import React from "react";
import ButtonSearch from "../common/buttonSearch";

export default function Provider_search() {
  return (
    <ThemeProvider>
      <div className="providerSearchContainer">
        <text className="providerSearch">Provider Search</text>

        <div margin="auto">
          <TextField />
          <div>
            <ButtonSearch />
          </div>
        </div>
      </div>
    </ThemeProvider>
  );
}
